
from operator import index


def FindP(text,pattern):
    indexes =[]
    
    for j in range(len(text)-len(pattern)):
        missmatch =0 
        for i in range(len(pattern)):
            if text[i+j] != pattern[i]:
                missmatch+=1
        if missmatch<=5:
            indexes.append(j)

    for ele in indexes:
        print(ele, end=" ")
        
text = ""
FindP(text,"ATTCGTGAGACC")
